  const [jokes, setJokes] = useState([]);

  // useEffect(() => {
  //   getJokes().then(data => setJokes(data));
  // }, []);

  return (
    <div>
      <h1>Home</h1>
      <div>
        {jokes.map(joke => (
          <Card key={joke.id} joke={joke} />
        ))}
      </div>
    </div>
  );
}

export default Home;
